import connkat from "./images/connkat.png";
import "./App.css";

function Nav() {
  return (
    <div className="Nav">
      <div className="logo">
        <img src={connkat} className="Nav-logo" alt="logo" />
      </div>
      <div className="links">
        <a href="./images/connkat-resume.pdf" download>
          Download Resume
        </a>
        <a href="mailto:hi.connkat@gmail.com" target="_blank" rel="noreferrer">
          Get in Touch
        </a>
      </div>
    </div>
  );
}

export default Nav;
